                    "body": "When going through a nether portal with a train with more than one wagon on the other side of it, it takes a very long time loading and after it finished loading you are in a half loaded nether with your inventory cleared. Shortly after your game just crashes.\r\n\r\nHow to recreate:\r\n-make a train track going through a portal\r\n-create a train with more than one wagons in the overworld\r\n-drive it through the portal\r\n-dismount the train and go back through the portal\r\n-then go back to the portal and the error should occur",
